import Form from "./Form";
import List from "./List";
import Footer from "./Footer";

function Todo() {

const [todos, setTodos] = useState([
    {
        done : false,
        text : "yapılcak 1"
    },{
        done : true,
        text : "yapılacak 2"
    },{
        done : true,
        text : "yapılacak 3"
    }
]);

  return (
    <div>
        <Form/>
        <List/>
        <Footer/>
    </div>
  )
}

export default Todo
